uint64_t target=65535;
int MAXDEPTH;
int mask;

char cbuf[8];
int buf[8];
void print() {
	printf("%d: (", target);
	for(int i = 0; i < MAXDEPTH; i++) {
		printf("%d, ", buf[i]);
	}
	puts("),");
}
int recursive(uint64_t res,char depth) {
	if (depth == MAXDEPTH) {
		if ((res&mask) == target) {
			print();
			return 1;
		}
		return 0;
	}
	for(int j = 0; j < 35; j++) {
		for(int i = 0; i < 10; i++) {
			cbuf[depth]=i+'0';
			buf[depth]=maps[i][j][0];
			if(recursive(res*maps[i][j][1]+maps[i][j][0],depth+1))
				return 1;
		}
	}
	return 0;
}

int main(int argc, char **argv) {
	target = atoi(argv[1]);
	mask = atoi(argv[2]);
	for(int j = 0; j < 5; j++) {
		MAXDEPTH=j+1;
		if(recursive(0,0)) break;
	}
}